pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
contract Exchange{

    struct reqDetails{
        string currency;
        uint256 fromAmt;
        uint256 toAmt;
        address fromMember;
        bool toToken;
        bool fromToken;
        uint valid;
    }

    struct memDetails{
        uint membership;
        string[] currencies;
        uint[] currencyAmt;
    }

    address token = 0x6912d034fbA564A145633dA36EC820EC1CDa61e3;
    address admin;
    mapping(address => reqDetails) requests;
    mapping(address => memDetails) memberDetails;
    address[] memRequested;

    modifier onlyAdmin () {
        require(msg.sender==admin);
        _;
    }

    modifier onlyMembers () {
        require(memberDetails[msg.sender].membership == 1);
        _;
    }

    constructor (){
        admin = msg.sender;
    }

    function register () public{
        memberDetails[msg.sender].membership = 1;
    }

    function unRegister () public onlyMembers{
        memberDetails[msg.sender].membership = 0;
    }

